import Card from './Card';
import React from 'react';

export default function Cards({characters, onClose}) {
   return (
      <div>
         {characters.map(
            ({id, name, status, species, gender, origin, image}) => {
               return(
                  <Card 
                     key={id}
                     id={id}
                     name={name}
                     status={status}
                     species={species}
                     gender={gender}
                     origin={origin.name}
                     image={image}
                     onClose={() => onClose(id)} 
                  />
               )
            }
         )}
      </div>
   )
}
